import React, { Component } from 'react';

class AntelopeValleyMap extends Component {
  constructor(props) {
    super(props);
    this.mapRef = React.createRef();
  }

  componentDidMount() {
    const antelopeValleyCoords = [
      { lat: 35.06982, lng: -118.24183 }, // Northeast corner
      { lat: 34.90070, lng: -118.23801 }, // Northwest corner
      { lat: 34.87145, lng: -118.44278 }, // Southeast corner
      { lat: 34.4, lng: -118.174806 }, // Southwest corner
    ];

    const mapOptions = {
      center: { lat: 34.8119, lng: -118.1644 }, // Center of Antelope Valley
      zoom: 10,
    };

    const map = new window.google.maps.Map(this.mapRef.current, mapOptions);

    // Create a Polygon to outline Antelope Valley
    const antelopeValleyPolygon = new window.google.maps.Polygon({
      paths: antelopeValleyCoords,
      strokeColor: '#FF0000', // Outline color (red)
      strokeOpacity: 0.8,
      strokeWeight: 2,
      fillColor: '#FF0000', // Fill color (red)
      fillOpacity: 0.10,
    });

    antelopeValleyPolygon.setMap(map);
  }

  render() {
    return <div ref={this.mapRef} style={{ width: '100%', height: '600px' }}></div>;
  }
}

export default AntelopeValleyMap;
